import React, {useState} from 'react';

import {useGlobalContext} from "../context";

const Dashboard = () => {
    const [loading, setLoading] = useState(false);
    const {user} = useGlobalContext();

    if (loading) {
        return (
            <>
                <h2>Loading...</h2>
            </>
        );
    }
    return (
        <div className='info'>
            <h2>
                <span>Dashboard</span>
            </h2>
            <p>
                Hello {user.name}
            </p>
        </div>
    );
};

export default Dashboard;
